import React, { useState } from 'react';

const Projects = () => {
  const [activeTab, setActiveTab] = useState('projects');
  const [projectImages, setProjectImages] = useState({});

  const projectsData = [
    {
      id: 1,
      title: "Word Document Clone",
      description: "Word Document Clone — A MEAN stack app for real-time document creation with rich text formatting, autosave, and multi-user collaboration.",
      tech: "React, Node.js, MongoDB, Express"
    },
    {
      id: 2,
      title: "Smart Loan System with ML integration", 
      description: "Automates loan eligibility and approval using predictive models, with secure workflows and dashboards; built with React, Node.js/FastAPI, and MongoDB.",
      tech: "React, Socket.io, Express, JWT, Python, mongoDB"
    },
    {
      id: 3,
      title: "E-Commerce Price Prediction using Web development and ML",
      description: "E-Commerce Price Prediction using Web Development & ML — Web app that predicts product prices from real-time data with interactive dashboards and APIs; built with React, Node.js/FastAPI, MongoDB, and Python (scikit-learn).", 
      tech: "Next.js, PostgreSQL, Prisma, AWS"
    }
  ];

  const certificates = [
    { name: "AWS Certified Developer", issuer: "Amazon Web Services", year: "2024" },
    { name: "React Developer Certification", issuer: "Meta", year: "2023" },
    { name: "Full Stack Web Development", issuer: "freeCodeCamp", year: "2023" }
  ];

  const techStack = {
    frontend: ["React", "Next.js", "TypeScript", "Tailwind CSS"],
    backend: ["Node.js", "Express", "Python", "Django"],
    database: ["MongoDB", "PostgreSQL", "Redis"],
    cloud: ["AWS", "Docker", "Kubernetes"]
  };

  const handleProjectImageUpload = (e, projectId) => {
    const file = e.target.files[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = (e) => {
        setProjectImages(prev => ({
          ...prev,
          [projectId]: e.target.result
        }));
      };
      reader.readAsDataURL(file);
    }
  };

  return (
    <section id="projects" className="projects">
      <div className="container">
        <h2>My Work</h2>
        <div className="project-tabs">
          <button 
            className={`tab-btn ${activeTab === 'projects' ? 'active' : ''}`}
            onClick={() => setActiveTab('projects')}
          >
            Projects
          </button>
          <button 
            className={`tab-btn ${activeTab === 'certificates' ? 'active' : ''}`}
            onClick={() => setActiveTab('certificates')}
          >
            Certificates
          </button>
          <button 
            className={`tab-btn ${activeTab === 'techstack' ? 'active' : ''}`}
            onClick={() => setActiveTab('techstack')}
          >
            Tech Stack
          </button>
        </div>

        {activeTab === 'projects' && (
          <div className="projects-grid">
            {projectsData.map((project) => (
              <div key={project.id} className="project-card">
                <div className="project-image-container">
                  {projectImages[project.id] ? (
                    <img src={projectImages[project.id]} alt={project.title} className="project-img" />
                  ) : (
                    <div className="project-image">Project {project.id}</div>
                  )}
                  <input
                    type="file"
                    accept="image/*"
                    onChange={(e) => handleProjectImageUpload(e, project.id)}
                    className="project-image-upload"
                    id={`project-upload-${project.id}`}
                  />
                  <label htmlFor={`project-upload-${project.id}`} className="project-upload-btn">
                    Upload Image
                  </label>
                </div>
                <div className="project-info">
                  <h3>{project.title}</h3>
                  <p>{project.description}</p>
                  <p className="tech-used">{project.tech}</p>
                </div>
                <div className="project-links">
                  <a href="#" className="btn-secondary">Live Demo</a>
                  <a href="#" className="btn-secondary">GitHub</a>
                </div>
              </div>
            ))}
          </div>
        )}

        {activeTab === 'certificates' && (
          <div className="certificates-grid">
            {certificates.map((cert, index) => (
              <div key={index} className="certificate-card">
                <h3>{cert.name}</h3>
                <p>{cert.issuer}</p>
                <span className="cert-year">{cert.year}</span>
              </div>
            ))}
          </div>
        )}

        {activeTab === 'techstack' && (
          <div className="techstack-grid">
            {Object.entries(techStack).map(([category, technologies]) => (
              <div key={category} className="tech-category">
                <h3>{category.charAt(0).toUpperCase() + category.slice(1)}</h3>
                <div className="tech-items">
                  {technologies.map((tech, index) => (
                    <span key={index} className="tech-item">{tech}</span>
                  ))}
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </section>
  );
};

export default Projects;
